import React, { useState } from "react";
import styles from "./Login.module.css";
import { useNavigate, Link } from "react-router-dom";
import axios from "axios";

const Login = () => {
  const [form, setForm] = useState({ email: "", password: "", role: "" });
  const navigate = useNavigate();

  // Dummy admin/superadmin accounts
  const dummyAdminAccounts = [
    { email: "superadmin@colony.com", password: "superadmin123", role: "Super Admin" },
    { email: "admin1@colony.com", password: "admin123", role: "Admin" },
    { email: "admin2@colony.com", password: "admin123", role: "Admin" },
    { email: "admin3@colony.com", password: "admin123", role: "Admin" },
    { email: "admin4@colony.com", password: "admin123", role: "Admin" },
    { email: "admin5@colony.com", password: "admin123", role: "Admin" },
    { email: "admin6@colony.com", password: "admin123", role: "Admin" },
  ];

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    
    // Check if trying to login as admin/superadmin with dummy credentials
    const isAdminLogin = form.role === "Admin" || form.role === "Super Admin";
    const isValidDummy = dummyAdminAccounts.some(
      account => 
        account.email === form.email && 
        account.password === form.password &&
        account.role === form.role
    );

    if (isAdminLogin && !isValidDummy) {
      alert("Only dummy admin accounts are allowed for testing. Use one of the predefined admin accounts.");
      return;
    }

    console.log("Login Details:", form);
    axios.post("http://localhost:8080/users/login", form)
      .then((response) => {
        const user = response.data;
        console.log(user);
        localStorage.setItem('userId', user.userId);
        switch (user.role) {
          case "Super Admin":
            navigate("/superadmindashboard");
            break;
          case "Admin":
            navigate("/admindashboard");
            break;
          case "User":
            navigate("/userdashboard");
            break;
          default:
            alert("Invalid role selected");
        }
      })
      .catch(error => {
        console.error("Login error:", error);
        alert("Login failed. Please check your credentials.");
      });
    
    setForm({ email: "", password: "", role: "" });
  };

  const handleDummyAdminLogin = (account) => {
    setForm({
      email: account.email,
      password: account.password,
      role: account.role
    });
  };

  return (
    <>
      <h1 className={styles.head}>My Colony</h1>
      <form className={styles.login} onSubmit={handleSubmit}>
        <h1>Login</h1>
        <input
          type="email"
          name="email"
          placeholder="Email Address"
          value={form.email}
          onChange={handleChange}
          required
        />
        <input
          type="password"
          name="password"
          placeholder="Password"
          value={form.password}
          onChange={handleChange}
          required
        />
        <select name="role" value={form.role} onChange={handleChange} required>
          <option value="">Select Role</option>
          <option value="Admin">Admin</option>
          <option value="Super Admin">Super Admin</option>
          <option value="User">User</option>
        </select>
        
        <div className={styles.dummyLogins}>
          <p>Admin Test Accounts:</p>
          <div className={styles.dummyButtons}>
            <button 
              type="button" 
              onClick={() => handleDummyAdminLogin(dummyAdminAccounts[0])}
              className={styles.dummyButton}
            >
              Super Admin
            </button>
            {dummyAdminAccounts.slice(1).map((account, index) => (
              <button
                key={index}
                type="button"
                onClick={() => handleDummyAdminLogin(account)}
                className={styles.dummyButton}
              >
                Admin {index + 1}
              </button>
            ))}
          </div>
        </div>

        <div className={styles.links}>
          <Link to="/forgot">Forgot Password?</Link>
        </div>
        <button type="submit">Log in</button>
      </form>
    </>
  );
};

export default Login;
